import logo from "./logo.svg";
import "./App.css";

function App() {
  const rows = 6;
  const columns = 7;

  let board = [];

  for (let j = 0; j < columns; j++) {
    for (let i = 0; i < rows; i++) {
      board[0][i] = "ezdze";
    }
  }

  console.table(board);

  return <div className="App"></div>;
}

export default App;
